import React,{useState} from "react";
import './LoginStyle.css';
export const LoginForm = () =>
{
    const[FirstName,setFirstName]=useState("");
    const[LastName,setLastName]=useState("");
    const[Email,setEmail]=useState("");
    const[MobileNo,setMobileNo]=useState("");
    const[DOB,setDOB]=useState("");
    const[Address,setAddress]=useState("");

    function onClick(e)
    {
     e.preventDefault();

    }
    return(
        <>
        <div class="top">
            <img id="img" src="https://divum.in/images/logo/Divum_Logo%20SVG%20(2).svg"/>
        </div>
        <form onSubmit={(onClick)}>
            <div class="front-view">

                <div class="head">

                    <h1><b>LOGIN FORM</b></h1>

             <div class="body">
            <label>FIRSTNAME:</label>
            <input type="text" value={FirstName} onChange={(e)=>setFirstName(e.target.value)} placeholder="Enter your firstname"></input><br></br><br></br>
            <label>LASTNAME :</label>
            <input type="text" value={LastName} onChange={(e)=>setLastName(e.target.value)} placeholder="Enter your lastname"></input><br></br><br></br>
            <label>EMAIL :</label>
            <input type="text" value={Email} onChange={(e)=>setEmail(e.target.value)} placeholder="Enter your email"></input><br></br><br></br>
            <label>MOBILENUMBER :</label>
            <input type="number" value={MobileNo} onChange={(e)=>setMobileNo(e.target.value)} pattern="[0-9]{10}" placeholder="Enter your MobileNo"></input><br></br><br></br>
            <label>DOB :</label>
            <input type="DATE" value={DOB} onChange={(e)=>setDOB(e.target.value)} placeholder="Enter your DOB"></input><br></br><br></br>
            <label>ADDRESS :</label><br></br>
            <textarea value={Address} onChange={(e)=>setAddress(e.target.value)} placeholder="Enter your Address" rows="3" cols="50"></textarea><br></br><br></br>
            <div class="btn">
            <button type="submit">SUBMIT</button>
                 </div>
                 </div>
            </div>
            </div>  
            </form>
        </>

    )
}
